def lists_with_product_equal_n(lst):
    def product(sublst):
        prod = 1
        for num in sublst:
            prod *= num
        return prod

    sublists = []
    n = len(lst)
    for i in range(n):
        for j in range(i, n):
            sublst = lst[i:j+1]
            if product(sublst) == 6:
                sublists.append(sublst)

    return sublists
